import React, {Component} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
    Col,
    Card, CardImg, CardText, CardBody,
    CardTitle, CardSubtitle, Button, CardDeck,
    DropdownMenu,
    DropdownItem } from 'reactstrap';
import {BrowserRouter} from 'react-router-dom';
export class States extends Component {
    constructor(props) {
      super(props);
    }
    componentDidMount() {
        fetch('http://3.84.54.129/api/congressmembers', { mode: 'no-cors' })
        .then(res => res.json())
        .then((data) => {
            console.log(data);
          this.setState({ state: data });
        })
        .catch(console.log)
      
    }
    render() {
      return (
        <div className="States" style={{paddingTop: "100px",width:"100%", height:"60%"}}>
           <div>
            <Col sm={{ size: 'auto'}}>
                <CardDeck>
                    <Card>
                        {/* <CardImg top width="80%" src={ohio} alt="Card image cap" /> */}
                        <CardBody>
                        <CardTitle>Ohio</CardTitle>
                                  <CardSubtitle>Population: 11,690,000</CardSubtitle>
                                  <CardSubtitle>GDP: 656.19 billion</CardSubtitle>
                                  <CardSubtitle>Region: Midwest</CardSubtitle>
                                  <CardSubtitle>Dominant Political Party: Republican</CardSubtitle>
                            <BrowserRouter>
                                <Button href= {"/state/ohio"} class="nav-link"  to={"/state/ohio"}> See More</Button>
                            </BrowserRouter>
                        </CardBody>
                    </Card>
                    <Card>
                        {/* <CardImg top width="80%" src={vermont} alt="Card image cap" /> */}
                        <CardBody>
                        <CardTitle>Vermont</CardTitle>
                                  <CardSubtitle>Population: 626,299</CardSubtitle>
                                  <CardSubtitle>GDP: 19.3 trillion</CardSubtitle>
                                  <CardSubtitle>Region: Northeast</CardSubtitle>
                                  <CardSubtitle>Dominant Political Party: Democrat</CardSubtitle>
                            <BrowserRouter>
                                <Button href= {"/state/vermont"} class="nav-link"  to={"/state/vermont"}> See More</Button>
                            </BrowserRouter>
                        </CardBody>
                    </Card>
                    <Card>
                              {/* <CardImg top width="80%" src={texas} alt="Card image cap" /> */}
                        <CardBody>
                        <CardTitle>Texas</CardTitle>
                                  <CardSubtitle>Population: 28,700,000</CardSubtitle>
                                  <CardSubtitle>GDP: 1.645 trillion</CardSubtitle>
                                  <CardSubtitle>Region: Southwest</CardSubtitle>
                                  <CardSubtitle>Dominant Political Party: Republican</CardSubtitle>
                            <BrowserRouter>
                                <Button href= {"/state/texas"} class="nav-link"  to={"/state/texas"}> See More</Button>
                            </BrowserRouter>
                        </CardBody>
                    </Card>
                    </CardDeck>
                </Col>
            </div>
       
        </div>
      );
    }
}

export default States;
